import React from 'react';

export default function InicioSesion(usuario, setUsuario, contrasena, setContrasena, login) {
  return (
    <div className="login-container">
        <h2 className="titulo text-xl">Login</h2>
        <label htmlFor="usuario">Usuario:
          <input
            type="text"
            id="usuario"
            value={usuario}
            onChange={(event) => setUsuario(event.target.value)}
          />
        </label>
        <label htmlFor="contrasena">Contrase√±a:
          <input
            type="password"
            id="contrasena"
            value={contrasena}
            onChange={(event) => setContrasena(event.target.value)}
          />
        </label>
        <button className="btn_ingresar bg-zinc-800" onClick={login}>Ingresar</button>
      </div>
  );
}
